import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { type } from '@testing-library/user-event/dist/type';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

